import React from 'react'

function Login() {
    return (
        <div className="bg-gray-200 w-3/4 m-auto mt-2">
            <form action="">
                <input type="text"/>
                <input type="text"/>
                <button>Login</button>
            </form>
        </div>
    )
}

export default Login
